// src/InterviewQuestionsPage.js
import React from 'react';
import Question from './Question';
import Sandbox from './CodeSandbox';

const Interview = () => {
    return (
        <div className="min-h-screen bg-gray-900 text-white py-12 px-6 flex flex-col items-center">
            <div className="container mx-auto flex flex-col lg:flex-row gap-12">
                {/* Question container */}
                <div className="flex-1 lg:w-1/2 bg-gray-800 rounded-lg p-6 max-h-[calc(100vh-160px)] overflow-y-auto">
                    <h1 className="text-3xl font-bold mb-8 text-center lg:text-left">
                        Technical Interview Practice
                    </h1>
                    <Question />
                </div>

                {/* Sandbox container */}
                <div className="flex-1 lg:w-1/2 bg-gray-800 rounded-lg p-6 max-h-[calc(100vh-160px)] overflow-y-auto">
                    <h2 className="text-2xl font-semibold mb-6 text-center lg:text-left">
                        Code Sandbox
                    </h2>
                    <Sandbox />
                </div>
            </div>
        </div>
    );
}

export default Interview;
